import React from 'react'

class InfoboxContainer extends React.Component {

    constructor(props) {
        super(props)
        this.plan = this.props.plan
    }

    render() {
        return (
            <div class="card mb-3">
                <img class="card-img-top" src={this.plan.name+".jpg"} alt="Card image cap" />
                <div class="card-body">
                    <h5 class="card-title">{this.plan.name} Insurance</h5>
                    <p class="card-text">{this.plan.description}</p>
                    <p class="card-text"><small class="text-muted">Avg. Cost: ${this.plan.cost}</small></p>
                </div>
            </div>
        )
    }
}

export default InfoboxContainer
